(2, 2, 'Město', '3', 'Máš to trochu posraný nejdřív Skuhrov pak Praha pak Gey město (nemyslíš si, že se to trochu sere???)', '0000-00-00 00:00:00'),
(3, 2, 'Fórum', '3', 'Nefunguje, kdo to napsal!<br />\r\nP.S. mám se vypisovat s dalšíma nebo to radši celý předěláš? :-P', '0000-00-00 00:00:00'),
(4, 2, 'Hacking', '1', 'Pls. už toho nech.', '0000-00-00 00:00:00'),
(5, 2, '', '8', 'To je fakt na hovno pavle....<br />\r\npracuj na tom tyv ole', '0000-00-00 00:00:00'),
(7, 2, '', '8', 'tady funguje jenom přispěvek..nemluvě o mapě a o foru', '0000-00-00 00:00:00'),
(9, 2, 'pro domažlice', '1', 'Vim teď jsem opravil to jméno tady už se zobrazuje.', '0000-00-00 00:00:00'),
(10, 3, 'Mapa', '1', 'Konečně byla zprovozněna mapa. Na začátku by každý měl mít uprastřed hlavní budovu pod ní dům, napravo sklad surovin, nahoře od skladu těžbu železa a směrem dolů by měla být těžba dřeva. Pokud to takhle nemáte napište mě.<br />\r\n<br />\r\nPostavit další budovu si můžete když kliknete na prázdné políčko vedle vás.<br />\r\n<br />\r\nDále bych chtěl upozornit, že změna podkladu nefunguje. Též nefungují tyto budovy: ambasáda.<br />\r\n<br />\r\nBudovy se dostaví tento pátek a dále se budou stavět automaticky každou půlnoc. Od dneska do sobotní půlnoci se nedají těžit suroviny(Dají se pouze stavět budovy).', '0000-00-00 00:00:00'),
(11, 4, 'Budovy a Suroviny', '1', 'Dnes (26.1.2008) jsem spustil funkci, která vždy o půlnoci dostaví všechny budovy přidá body, populaci a přičte suroviny z těžeb.<br />\r\n<br />\r\nSuroviny:<br />\r\npeníze(zatím k ničemu)<br />\r\njídlo(zatím k ničemu)<br />\r\nkámen(na stavění budov)<br />\r\nželezo(zatím k ničemu)<br />\r\ndřevo(na stavění budov)', '0000-00-00 00:00:00'),
(12, 4, 'body', '31', 'Podle čeho se počítají body????????????', '0000-00-00 00:00:00'),
(13, 2, '???', '31', 'Vo co se jedná??????????????', '0000-00-00 00:00:00'),
(14, 3, 'isometrická mapa', '31', 'Bude nějaká???', '0000-00-00 00:00:00'),
(15, 1, 'no konečně', '31', 'to ti to trvalo...', '0000-00-00 00:00:00'),
(16, 5, 'mapa -nápad', '31', 'Čau, co takhle přidat isometrickou mapu???', '0000-00-00 00:00:00'),
(17, 5, 'šeš divnej', '2', 'to by we webovim prohlížeči nešlo, vdýť bi jse to sekalo?,', '0000-00-00 00:00:00'),
