(22, 3, 'jj', '1', 'Bude, ta normální je na ***** jenom mě tam blbne pár věcí.', '0000-00-00 00:00:00'),
(23, 5, 'a', '1', 'Neni to taková blbost. Isometrická mapa bude, ta normální je na ***** jenom mě tam blbne pár věcí. Už jsem to tady říkal v tématu Mapa.', '0000-00-00 00:00:00'),
