(311, 44, '', '100', 'Mne osobne sa ta hra velmi paci, az na zopar nedokonalosti ktore sa iste casom spravia. Prosim do tejto temy nepiste prispevky ako ''tato hra je na *****'' alebo ''vsetko je tu posrate'' alebo ''Pavel Hejny je ....''. Piste tu len objektivne veci.Ak tu napisem ja alebo niekto iny nieco zle, tak ho/mna kludne opravte.<br />\r\n<br />\r\n- Nejdu trenovat vojaci<br />\r\n- Budova trziste nerobi nic<br />\r\n- Budova pole sa aspon da zburat ale neda sa vyuzivat<br />\r\n- Budova Vez vypisuje chybove hlasenie<br />\r\n- Ked si chcem postavit budovu tak tam je jedna ktora sa neda postavit(nieje tam link)<br />\r\n- Jedlo je zatial na nic<br />\r\n- Obcas sa nezobrazi mapa<br />\r\n- Body sa pridavaju iba mestu a nie hracom a alianciam<br />\r\n- Nwm ako funguje shromazdiste, lebo sa mi tam zatial nepodarilo nic poslat<br />\r\n- Vo fore b l b n u html tagy<br />\r\nTo admin: toto nie je myslene ako kritika, tym ti chcem pomoct aby si mal konkretny zoznam chyb co by mohlo prispiet ku efektivnosti ich odstranenia', '2008-05-07 16:18:02'),
(312, 44, 're: naozajstne chyby', '1', 'Diky za pripomienky, konecne tu mam nejaky objektivny nazor... pre tie co mam vysvetlenie som tu napisal na ostatne sa pozrem ked budu urobene dolezitejsie.<br />\r\n<br />\r\n-Trenovanie vojakov a body je chyba jednoho skriptu<br />\r\n-Budova trziste bude nieco robit iba tam bol vazny bug a tak som ju docasne znefunkcnil<br />\r\n-Budova pole bude vytvarat jedlo na vylepsovanie - a to tiez este nefunguje.<br />\r\n-Mapa sa uz zobrazuje<br />\r\n-Body som uz opravil', '2008-05-11 20:46:15'),
(313, 42, 'taky nejde', '58', 'Mě to dělá to samé.', '2008-05-12 09:47:05'),
