(319, 45, 'Mapa', '1', 'Vylepšil jsem leteckou mapu:<br />\r\n- Dá se zoomovat na jakýkoliv zoom.<br />\r\n- Políčka, která jsou podsvícena šedě, jsou vaše.<br />\r\n- Při najetí na políčko se v pravo dole zobrazí víc informací o políčku.<br />\r\n- Mapa reaguje rychleji.<br />\r\n- Když si po přihlášeni mapu zobrazíte najede vám přesně vycentrované vaše město.<br />\r\n- Políčko PLUS funguje.', '2008-05-20 11:50:21'),
