(229, 1, 58, 3, '2008-03-11 19:24:55', 'spolupráce - ', 'Hosting máš dobrý, ale já taky a já si myslim, že hrát by se mělo na towns.cz a ne na towns.portik.cz Není to nic proti tobě, ale já si to ještě přemýšlel a mslím si, že by to tak mělo být.<br />\r\n<br />\r\nPS: dám ti dalších 100 000 peněz<br />\r\n----------<br />\r\nVčera jsi dal 30 000.&lt;br /&gt;<br />\r\n----------&lt;br /&gt;<br />\r\nJá ti dal alespoň 100 000.&lt;br /&gt;&lt;br /&gt;<br />\r\n----------&lt;br /&gt;&lt;br /&gt;<br />\r\nJen 30 000 tisíc? Vždyť já toho objevil víc než 1 a půl chyby.'),
